import React from "react";

function Navbar() {
  return (
    <div>
      <Navbar bg="light" expand="lg">
        <Navbar.Brand href="#home">React-Bootstrap</Navbar.Brand>
      </Navbar>
    </div>
  );
}

export default Navbar;
